import React from "react";
import "./soundWave.style.css";
import soundWaves from "../photos/soundWave.eps";

const SoundWave = () => {
  const image = require("../photos/soundWave.eps");
  return (
    <div class="sound">
      <img
        class="img"
        src="https://image.shutterstock.com/image-vector/abstract-blue-digital-equalizer-vector-600w-720906511.jpg"
        alt=""
      />
      <p>soundwave</p>
    </div>
  );
};

export default SoundWave;
